import './App.css';
import Login from './screens/Auth/Login.jsx';

import { BrowserRouter as Router,  Route, Routes } from "react-router-dom";
import ForgotPassword from './screens/Auth/ForgotPassword.jsx';
import Signup from './screens/Auth/Signup.jsx';
import Dashboard from './screens/dashboard/Dashboard.jsx';
import InquiryForm from './screens/InquiryForm/inquiry_form.jsx';
import StuProfile from './screens/student_profile/StuProfile.jsx';

function App() {
  return (
    // <div style={{ padding: "20px" }}>
    //   <h1>IT Academy Inquiry Form</h1>
    //   <Signup />
    // </div>
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/ForgotPassword" element={<ForgotPassword />} />
        <Route path="/Signup" element={<Signup />} />
        <Route path="/Login" element={<Login />} />
        <Route path="/ForgotPassword" element={<ForgotPassword />} />
        <Route path='/Dashboard' element={<Dashboard />} />
        <Route path="/inquiry" element={<InquiryForm />} />
        <Route path='/studentprofile' element={<StuProfile />} />
      </Routes>
    </Router>
  );
}

export default App;
